import React from 'react'
import Main from '../components/Main'
import requests from '../Requests'
import Row from '../components/Row'


const Home = () => {
  return (
    <>
        <Main/>
        <Row title='Up coming' fetchURL={requests.requestUpcoming}/>
    </>
  )
}

export default Home
